import ExpenseItem from "./components/ExpenseItem";


function App() {
    document.getElementById("root");

    const expenses = [
        {   id: 'e1',
            expenseTitle: "Car Insurance",
            expenseAmount: 294.67,
            expenseDate: new Date(2023, 7, 27)
        }
    ];
  return (
    <div>
        <h2>Let's get started!</h2>
        <ExpenseItem/>
        <ExpenseItem/>
        <ExpenseItem/>
        <ExpenseItem/>
    </div>
  );
}

export default App;
